contract ScavengerHunt{

mapping(uint=>Game) Games;
mapping(address=>uint[]) GameID;
mapping(address=>uint) TotalGames;
mapping(address=>uint[]) RegisteredGames;
mapping(uint=>bool) GameValid;
uint totalGames;

struct Game{
 address judge;
 address creator;
 uint numberOfPlayers;
 uint registeredPlayers;
 uint playerWagerRequirement;
 mapping(uint=>address) players;
 mapping(address=>bool) registered;
  mapping(address=>bool) Wagered;
 uint startDate;
 uint endDate;
 uint numberOfGoals;
 uint goalsVerified;

 mapping(uint=>Goal) Goals;
 mapping(address=>uint) playerPoints;
 mapping(address=>uint) playerID;
}

struct Goal{
 uint location;
 string Info;
 uint points;
 bool Verified;
 uint submissionTotal;
 mapping(address=>Submission) Submissions;
 mapping(uint=>address) Order;
}
struct Submission{
  uint time;
  uint location;
  bytes32 IPFShash;
  address sender;
}

function CreateGame(uint _numberOfPlayers,uint Wager,uint Start,uint End,uint totalGoals,address _judge){
Game memory temp =Game(_judge,msg.sender,_numberOfPlayers,0,Wager,Start,End,totalGoals,0);
 uint mygames=TotalGames[msg.sender];
 GameID[msg.sender][mygames]=totalGames;
 Games[totalGames]=temp;
 TotalGames[msg.sender]+=1;
 totalGames+=1;
}

function SetGoal(uint _game,uint goal,uint location,string info,uint points){
require(msg.sender==Games[_game].creator);
require(goal<Games[_game].numberOfGoals);
require(now<Games[_game].startDate);
Game storage temp=Games[_game];
Goal memory newGoal= Goal(location,info,1,false,0);
temp.Goals[goal]=newGoal;
}

function registerGoal(uint _game,uint goal,bytes32 IPFShash,uint location){
  require(Games[_game].registered[msg.sender]==true);
  require(Games[_game].numberOfGoals>goal);
  Submission memory Sub=Submission(now,location,IPFShash,msg.sender);
  Game storage temp=Games[_game];
  uint count=temp.Goals[goal].submissionTotal+1;
  temp.Goals[goal].Submissions[msg.sender]=Sub;
  temp.Goals[goal].Order[count]=msg.sender;
  temp.Goals[goal].submissionTotal=count;

}

function registerPlayer(address player,uint _game){

require(now<Games[_game].startDate);
require(msg.sender==Games[_game].creator);
require(Games[_game].registeredPlayers<Games[_game].numberOfPlayers);
require(Games[_game].registered[player]==false);
Game storage temp=Games[_game];
uint count=temp.registeredPlayers+1;
temp.players[count]=player;
temp.registered[player]=true;
temp.playerID[player]=count;
temp.registeredPlayers=count;
}


function playerWager(uint _game) payable{
  Game storage temp=Games[_game];
  require(now<Games[_game].startDate);
  require(temp.registered[msg.sender]==true);
  require(msg.value>=temp.playerWagerRequirement);
  temp.Wagered[msg.sender]=true;
}
function withDrawPlayerWager(uint _game){
  require(now>Games[_game].endDate);
  require(Games[_game].registeredPlayers==Games[_game].numberOfPlayers);
  uint amount= (Games[_game].playerWagerRequirement*Games[_game].numberOfPlayers*1000*Games[_game].playerPoints[msg.sender])/(Games[_game].numberOfGoals);
  Games[_game].playerPoints[msg.sender]=0;
  msg.sender.transfer(amount);
}

function VerifyGoal(uint _game,uint _goal,uint order){
  require(msg.sender==Games[_game].judge);
  Game storage temp=Games[_game];
  temp.Goals[_goal].Verified=true;
  temp.goalsVerified+=1;
  address player=temp.Goals[_goal].Order[order];
  Submission storage sub= temp.Goals[_goal].Submissions[player];
  temp.playerPoints[sub.sender]+=temp.Goals[_goal].points;
}



function GetPlayerInfo(address player,uint _game) constant returns(uint,uint,bool,bool){
 return(Games[_game].playerID[player],Games[_game].playerPoints[player],Games[_game].Wagered[player],Games[_game].registered[player]);
}
function GetGameDetails(uint _game) constant returns(address,address,uint,uint,uint,uint,uint,uint,uint){
  Game memory temp=Games[_game];
  return(temp.judge,temp.creator,temp.numberOfPlayers,temp.registeredPlayers,temp.playerWagerRequirement,temp.startDate,temp.endDate,temp.numberOfGoals,temp.goalsVerified);
}
function GetGoalDetails(uint _game,uint _goal) constant returns(uint,string,uint,bool,uint){
  Goal memory temp=Games[_game].Goals[_goal];
  return(temp.location,temp.Info,temp.points,temp.Verified,temp.submissionTotal);
}
function GetSubmission(address player,uint _game,uint _goal) constant returns(uint,bytes32){
Submission memory temp=Games[_game].Goals[_goal].Submissions[player];
return(temp.time,temp.IPFShash);
}
function GetGamesArray(address user) constant returns(uint[]){
  return GameID[user];
}
function SetGameID(uint n){
      GameID[msg.sender].push(n);

  }
}
